import React from "react";
import PropTypes from "prop-types";
import "./Image.css";

function Image(props) {
  return (
    <div className="images">
      <span>{props.likes}</span>
    </div>
  );
}

Image.propTypes = {
  name: PropTypes.string.isRequired
};

export default Image;
